import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  }, []);

  return (
    <div>
      <h1>Elanco's Cloud Environment Data</h1>
      <table>
        <thead>
          <tr>
            <th>Application Name</th>
            <th>Compute Resource</th>
            <th>Cost</th>
            <th>Usage</th>
          </tr>
        </thead>
        <tbody>
          {data.map(item => (
            <tr key={item.id}>
              <td>{item.applicationName}</td>
              <td>{item.computeResource}</td>
              <td>{item.cost}</td>
              <td>{item.usage}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
